SELECT MIN("cast_info"."person_role_id") as agg_0 FROM "aka_name" LEFT OUTER JOIN "name" ON "aka_name"."person_id" = "name"."id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id"  WHERE "char_name"."name_pcode_nf" NOT LIKE '%H52%41%' AND ("aka_name"."surname_pcode" != 'H12' OR "aka_name"."surname_pcode" LIKE '%B65%' OR "aka_name"."surname_pcode" IN ('B62', 'M2', 'B65', 'R2', 'J52', 'M6', 'B2', 'L')) AND "aka_name"."name_pcode_cf" NOT LIKE '%A53%62%' AND "cast_info"."note" LIKE '%(voice)%' AND "person_info"."person_id" <= 1667057;
SELECT MIN("title"."production_year") as agg_0 FROM "movie_info" LEFT OUTER JOIN "title" ON "movie_info"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id"  WHERE "title"."episode_nr" BETWEEN 2.5560685973160195 AND 72663.56218926107 AND "kind_type"."kind" != 'video game';
SELECT SUM("cast_info"."person_id" + "movie_info"."id") as agg_0 FROM "movie_info" LEFT OUTER JOIN "title" ON "movie_info"."movie_id" = "title"."id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "info_type" ON "movie_info_idx"."info_type_id" = "info_type"."id" LEFT OUTER JOIN "aka_name" ON "cast_info"."person_id" = "aka_name"."id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id"  WHERE "keyword"."phonetic_code" LIKE '%R1%652%' AND "movie_info_idx"."info" LIKE '%7.7%';
SELECT COUNT(*) as agg_0 FROM "title" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id"  WHERE "movie_info_idx"."id" >= 623508 AND ("movie_info_idx"."info" LIKE '%7%.8%' OR "movie_info_idx"."info" LIKE '%7.8%');
SELECT MIN("cast_info"."person_id") as agg_0 FROM "name" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id"  WHERE "char_name"."id" <= 1451137 AND "aka_name"."surname_pcode" IS NOT NULL;
